export default class Admin extends Component {
  render() {
    return (
      <div className="cards">
        <AjouterRecette
          AjouterRecette={this.props.AjouterRecette}
        ></AjouterRecette>
        <footer>
          <button onClick={this.props.chargerExemple}>Remplir</button>
        </footer>
      </div>
    );
  }
}
